) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

--
-- Volcado de datos para la tabla `ejercicios`
--

INSERT INTO `ejercicios` (`nombre`, `descripcion`, `id_ejercicio`) VALUES
('Curva lateral terrestre con barra', 'Párese derecho y sostenga el extremo de la barra Mantenga las caderas y los hombros mirando hacia adelante, inclínese hacia un lado lentamente. Regrese a la posición vertical. Cambia de manos y repite.', 26),
('Sentadilla con barra', 'Párese con los pies separados al ancho de los hombros. Mantenga el arco natural de la espalda, apretando los omoplatos y elevando el pecho. Agarra la barra sobre tus hombros y apóyala en la parte superior de tu espalda. Desenrolla la barra estirando las p', 27),
('Estocadas hacia adelante', 'Baje su cuerpo hasta que su rodilla trasera casi toque el suelo. Asegúrese de permanecer erguido y de que su rodilla delantera permanezca por encima del pie delantero. Empuje el piso con el pie delantero hasta que regrese a la posición inicial. Cambia de ', 28),
('Extensión de pierna', 'Siéntese en la máquina con la espalda contra el cojín y ajuste la máquina que está utilizando para que sus rodillas estén en un ángulo de 90 grados en la posición inicial. Levante el peso extendiendo las rodillas hacia afuera, luego baje la pierna a la po', 29),
('Elevaciones de pantorrillas de pie', 'Ajuste la máquina de acuerdo con su altura y coloque los hombros debajo de la palanca acolchada. Las puntas de los pies deben soportar su peso en el bloque de la pantorrilla, los talones se extienden fuera de él. Extienda los talones hacia arriba mientras', 30),
('peso muerto', 'Párese con la parte media del pie debajo de la barra y agarre la barra con las manos, separadas aproximadamente el ancho de los hombros. Doble las rodillas, luego levante la barra enderezando la espalda. Es importante mantener la espalda recta. Ponte de p', 31),
('Extensión de espalda de 45 grados', 'Coloque los muslos sobre el acolchado y enganche los pies en los soportes de la plataforma. Manteniendo la espalda recta, doble lentamente la cintura hasta que las piernas y la espalda formen un ángulo de 45°. Lentamente levante su cuerpo a la posición in', 32),
('Encogimiento de hombros sentado con manc', 'Siéntese en un banco con mancuernas en ambas manos, con las palmas hacia el cuerpo y la espalda recta. Eleve los hombros y mantenga la posición contraída en el vértice del movimiento. Baje lentamente los hombros a la posición inicial. ', 33),
('Remo vertical con barra ', 'Tome un agarre doble por encima de la cabeza aproximadamente al ancho de los hombros. Tire de los codos hacia arriba del techo. Trate de llevar la barra al nivel de la barbilla o un poco más arriba.', 34),
('Press por encima de la cabeza', 'Tome un agarre más o menos al ancho de los hombros. Debe haber una línea recta desde el codo hasta el puño (antebrazos verticales). Tire de la barbilla hacia atrás y presione el peso hacia el techo extendiendo la articulación del codo y flexionando la art', 35),
('press de banca', 'Acuéstese en el banco con los pies en el suelo. Con los brazos rectos desmonta la barra. Baje la barra a la mitad de su pecho. Levanta la barra hasta que hayas bloqueado los codos.', 36),
('Aperturas de pecho inclinadas con mancue', 'Acuéstese en el banco y coloque los pies en el suelo. Comience el ejercicio con las mancuernas juntas sobre su pecho, los codos ligeramente doblados. Simultáneamente, baje los pesos a ambos lados. Haga una pausa cuando las pesas estén paralelas al banco, ', 37),
('Press de banca inclinado con barra', 'Coloque el banco entre 30 y 45 grados. Acuéstese en el banco con los pies en el suelo. Con los brazos rectos desmonta la barra. Baje la barra a la mitad de su pecho. Levanta la barra (lentamente y de forma controlada) hasta que hayas bloqueado los codos.', 38),
('Curl con barra', 'Mientras mantiene la parte superior de los brazos estacionaria, doble las pesas hacia adelante mientras contrae los bíceps mientras exhala. Continúe el movimiento hasta que sus bíceps estén completamente contraídos y la barra esté al nivel de los hombros.', 39),
('Dominadas', 'Agarre la barra separada a la anchura de los hombros con un agarre en posición supina (las palmas hacia usted) Con el cuerpo colgando y los brazos completamente extendidos, levántese hasta que la barbilla pase la barra. Vuelva lentamente a la posición ini', 40),
('Curl martillo con mancuernas', 'Sujeta las mancuernas con un agarre neutral (pulgares hacia el techo). Lentamente levante la mancuerna hasta la altura del pecho. Vuelve a la posición inicial y repite.', 41),
('Extensión de muñeca con mancuernas', 'Coge dos mancuernas con un agarre en pronación y coloca los antebrazos sobre las rodillas. Deje que sus muñecas se flexionen por completo, luego extiéndalas.', 42);

